        );

        bytes32 hashMsg = keccak256(
            abi.encode(
                __STR_OCNEWLOCK_HASH__,
                _expirationDuration,
                _keyPrice,
                _maxNumberOfKeys,
                keccak256( abi.encodePacked( _lockName ) )
            )
        );

        bytes32 singhash = keccak256( abi.encodePacked( "\x19\x01", hashEIP712Domain, hashMsg ) );

        return SignerOfMsg( singhash, _signature );
    }
}
